const Footer = () => {
    return (
        <div className="footer">
            <h4>Ziv Talmon &copy;</h4>
            <ul>
                <li><img src='icons8-facebook-50.png'></img></li>
                <li><img src='icons8-github-50.png'></img></li>
                <li><img src='icons8-linkedin-circled-50.png'></img></li>
            </ul>
        </div>
    )
}

export default Footer
